import React from "react";
import ReactDOM from "react-dom";
import { BrowserRoute } from "react-router-dom";
import "./index.css";
import App from "./App";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRoute>
      <App />
    </BrowserRoute>
  </React.StrictMode>,
  document.getElementById("root")
);
